import "./Main.css";

function Main() {
  return (
    <div>
        <div id="notesSideBar">
          <div>
            <button>Add Note</button>
            <button>Delete</button>
          </div>
        </div>
        <div id="notesList">

        </div>
    </div>
  );
}

export default Main;
